import React from "react";
import PropTypes from "prop-types";
import "antd/dist/antd.css";
const App = ({ Component }) => <Component />;

App.propTypes = {
  //점검을해주자 점검을하면 서비스의 안전성 ↑
  Component: PropTypes.elementType.isRequired,
};
export default App;
